// ===========================
// Import React
// ===========================
import React from "react";

// ===========================
// Import chef images (matching your actual files)
// ===========================
import Chef1Img from "../components/chef1.jpg";
import Chef2Img from "../components/chef2.jpg";
import Chef3Img from "../components/chef3.jpg";
import Chef4Img from "../components/chef4.jpg";
import Chef5Img from "../components/chef5.jpg"; // Optional: include if you have a 5th chef

// ===========================
// ChefGrid component
// ===========================
export default function ChefGrid() {
  return (
    <section className="chef-grid container">
      {/* ===========================
          Grid heading
      =========================== */}
      <h2>Meet Our Chefs</h2>

      {/* ===========================
          Chef cards container
      =========================== */}
      <div className="grid">
        {/* ===========================
            Chef 1
        =========================== */}
        <div className="chef-card">
          <img src={Chef1Img} alt="Chef 1" />
          <h3>Maria</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* ===========================
            Chef 2
        =========================== */}
        <div className="chef-card">
          <img src={Chef2Img} alt="Chef 2" />
          <h3>Marcus</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* ===========================
            Chef 3
        =========================== */}
        <div className="chef-card">
          <img src={Chef3Img} alt="Chef 3" />
          <h3>Luis</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* ===========================
            Chef 4
        =========================== */}
        <div className="chef-card">
          <img src={Chef4Img} alt="Chef 4" />
          <h3>Ana</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>

        {/* ===========================
            Chef 5 (optional)
        =========================== */}
        <div className="chef-card">
          <img src={Chef5Img} alt="Chef 5" />
          <h3>Additional Chef</h3>
          <p>Delicious meals, exceptional deals</p>
        </div>
      </div>
    </section>
  );
}
